import React from "react";
import Products_Details from "./Products_Detail";
const Products = [
  {
    name: "T-shirt",
    title: "T-shirt",
    id: 1,
    img:
      "data:image/jpeg;base64,",
    description: "mast hn bhai",
  },
  {
    name: "T-shirt",
    title: "T-shirt",
    id: 1,
    img:
      "data:image/jpeg;base64,",
    description: "mast hn bhai",
  },
  {
    name: "T-shirt",
    title: "T-shirt",
    id: 1,
    img:
      "data:image/jpeg;base64,",
    description: "mast hn bhai",
  },
  {
    name: "T-shirt",
    title: "T-shirt",
    id: 1,
    img:
      "data:image/jpeg;base64,",
    description: "mast hn bhai",
  },
];

function Product() {
  return (
    <>
      <div>
        {Products.map((product) => (
          <div>
            <Products_Details product={product} />;
          </div>
        ))}
      </div>
    </>
  );
}
export default Product;
